import React from 'react';
import PropTypes from 'prop-types';

const Project = () => {
  const projects = [
    {
      title: "AgroMaart - Online Fertilizer Shop",
      icon: "ri-shopping-cart-fill",
      description: "Built a user-friendly web application to make fertilizer shop management easier and improve communication between shop owners, farmers, and delivery staff. The app includes Role-Based Access, giving each user group specific tools: shop owners can manage inventory and orders, farmers can browse products, see prices, place orders, and track deliveries, while delivery staff can update delivery status in real-time to keep everyone informed. Spring Security ensures safe login and data protection. This platform has made fertilizer distribution more efficient by connecting all users on one platform, reducing manual work, and boosting transparency in operations.",
      additionalInfo: "Technologies: Spring Boot, Hibernate, MySQL, React, HTML, CSS",
      imageSrc: require('../../assets/images/AgroMart.webp'),
      animation: "fade-left",
    },
    {
      title: "Students Management System",
      icon: "ri-book-2-fill",
      description: "The Students Management System is a web-based application designed to manage student records efficiently. It allows administrators to enroll students, update their information, and retrieve records easily. The system ensures secure access and data accuracy while providing a user-friendly interface for smooth navigation. With features like search and modification, it simplifies student data management. This application helps reduce manual work and enhances overall efficiency in handling academic records",
      additionalInfo: "Technologies: Spring Boot, Hibernate Thymeleaf, MySQL",
      imageSrc: require('../../assets/images/studentManagementSystem.webp'),
      animation: "fade-left",
    },
    {
      title: "Employee Management System",
      icon: "ri-user-3-fill",
      description: "A Java-based system utilizing MySQL and Hibernate for efficiently managing employee details, roles, and salary records with CRUD operations.",
      additionalInfo: "Technologies: Java, MySQL, Hibernate",
      animation: "fade-left",
    },
    {
      title: "Akshay Balte Portfolio",
      icon: "ri-portfolio-fill",
      description: "A portfolio website built with React, JavaScript, HTML, and CSS showcasing skills, projects, and achievements in an interactive and responsive format.",
      additionalInfo: "Technologies: React, JavaScript, HTML, CSS",
      animation: "fade-left",
    },
  ];

  return (
    <section id="project" style={styles.section}>
      <div style={styles.container}>
        <div style={styles.sectionHeader}>
          <h2 style={styles.sectionTitle}>Projects</h2>
        </div>
        <div style={styles.gridContainer}>
          {projects.map((project, index) => (
            <TimelineCard key={index} index={index} {...project} />
          ))}
        </div>
      </div>
    </section>
  );
};

const TimelineCard = ({ title, icon, description, additionalInfo, imageSrc, animation, index }) => {
  const cardStyle = {
    ...styles.cardContainer,
    backgroundColor: colorPalette[index % colorPalette.length],
    padding: '2rem',
    minHeight: '250px',
  };

  return (
    <div className="timeline-card" style={cardStyle} data-aos={animation}>
      <div style={styles.iconContainer}>
        <img src={imageSrc} alt={`Icon for ${title}`} style={styles.iconImage} />
      </div>
      <div style={styles.cardContent}>
        <h3 style={styles.cardTitle}>
          {icon && <i className={`${icon} mr-2`} aria-hidden="true"></i>} {title}
        </h3>
        <p style={styles.cardDescription}>{description}</p>
        {additionalInfo && <p style={styles.cardAdditionalInfo}>{additionalInfo}</p>}
      </div>
    </div>
  );
};

TimelineCard.propTypes = {
  title: PropTypes.string.isRequired,
  icon: PropTypes.string,
  description: PropTypes.string.isRequired,
  additionalInfo: PropTypes.string,
  imageSrc: PropTypes.string.isRequired,
  animation: PropTypes.string.isRequired,
  index: PropTypes.number.isRequired,
};

const colorPalette = ['#e3f2fd', '#e8f5e9', '#fff3e0', '#f3e5f5', '#fbe9e7'];

const styles = {
  section: {
    padding: '5rem 2rem',
    background: 'linear-gradient(135deg, #d7e9f7, #e1f5fe)',
    borderRadius: '1rem',
    boxShadow: '0 8px 20px rgba(0, 0, 0, 0.1)',
  },
  container: {
    maxWidth: '1200px',
    margin: '0 auto',
    padding: '2rem',
  },
  sectionHeader: {
    textAlign: 'center',
    marginBottom: '4rem',
  },
  sectionTitle: {
    color: '#0288d1',
    fontWeight: '600',
    fontSize: '3rem',
  },
  gridContainer: {
    display: 'grid',
    gridTemplateColumns: 'repeat(auto-fit, minmax(450px, 1fr))',
    gap: '2.5rem',
  },
  cardContainer: {
    display: 'flex',
    alignItems: 'center',
    gap: '2rem',
    padding: '2rem',
    borderRadius: '1rem',
    boxShadow: '0 8px 20px rgba(0, 0, 0, 0.1)',
  },
  iconContainer: {
    flexShrink: 0,
  },
  iconImage: {
    width: '90px',
    height: '90px',
    objectFit: 'cover',
    borderRadius: '50%',
  },
  cardContent: {
    flex: 1,
  },
  cardTitle: {
    fontWeight: '700',
    fontSize: '2rem',
    color: '#0277bd',
  },
  cardDescription: {
    fontSize: '1.1rem',
    color: '#455a64',
    marginTop: '0.75rem',
  },
  cardAdditionalInfo: {
    fontSize: '1rem',
    color: '#607d8b',
    marginTop: '0.5rem',
    fontStyle: 'italic',
  },
};

export default Project;
